    #UI to Python
    #Change the slider value according to the motors
    def on_dropdown_changed(self, index):
        slider_ranges = {
            0: (70, 180), 1: (140, 300), 2: (120, 280), 3: (120, 280), 4: (120, 280),
            5: (200, 380), 6: (240, 450), 7: (120, 280), 8: (30, 180), 9: (60, 220)
        }
        
        load_ranges = {
            0: (-55, 55), 1: (-125, 125), 2: (-200, 200), 3: (-198, 198), 4: (-271, 271),
            5: (-203, 203), 6: (-220, 220), 7: (-657, 657), 8: (-20, 20), 9: (-59, 59)
        }
        
        rpm_max_values = [7500, 9000, 8000, 8000, 10000, 13000, 11000, 15000, 5000, 7000]
        
        if index in slider_ranges:
            volt_min, volt_max = slider_ranges[index]
            load_min, load_max = load_ranges[index]
            
            self.volt_slider.setMinimum(volt_min)
            self.volt_slider.setMaximum(volt_max)
            self.rpm5_slider.setMinimum(0)
            self.rpm5_slider.setMaximum(rpm_max_values[index])
            self.rpm5_slider.setTickInterval(1000)
            self.load5_slider.setMinimum(load_min)
            self.load5_slider.setMaximum(load_max)
        ##
    # Displays the values in labels after clicking the run button
    def set_motor_values(self, motor_spec, index, editable, tick_interval, single_step, page_step):
        motor_name = motor_spec[0]
        self.mot_name_6.setText(str(motor_name))
        ##
        motor_min_voltage = motor_spec[5]
        self.min_v_6.setText(str(motor_min_voltage))
        ##
        motor_max_speed_rpm = motor_spec[4]
        self.r_rpm_6.setText(str(motor_max_speed_rpm * 0.8))
        ##
        self.max_rpm_6.setText(str(motor_max_speed_rpm))
        ##
        motor_max_regen_torque = motor_spec[3]
        self.regen_lim_6.setText(str(motor_max_regen_torque))
        ##
        motor_manufacture_name = motor_spec[1]
        self.manufac_6.setText(motor_manufacture_name)
        ##
        motor_max_current = motor_spec[6]
        self.max_i_6.setText(str(motor_max_current))
        ##
        motor_max_torque = motor_spec[2]
        self.r_torq_6.setText(str(motor_max_torque * 0.8))
        ##
        self.max_torq_6.setText(str(motor_max_torque))
        ##
        self.motor_select_6.setEditable(editable)
        self.load5_slider.setTickInterval(tick_interval)
        self.load5_slider.setSingleStep(single_step)
        self.load5_slider.setPageStep(page_step)
    ##
    def run_motor_specs(self, index):
        motor_spec = motor_specs()
        if index == 0:
            self.set_motor_values(motor_spec, index, False, 15, 2, 10)
        elif index in [1, 2, 3, 4, 5]:
            self.set_motor_values(motor_spec, index, False, (index + 1) * 10, 2, 2 * (index + 1))
        elif index == 6:
            self.set_motor_values(motor_spec, index, False, 30, 2, 50)
        elif index == 7:
            self.set_motor_values(motor_spec, index, False, 85, 2, 50)
        elif index == 8:
            self.set_motor_values(motor_spec, index, False, 5, 2, 5)
        elif index == 9:
            self.set_motor_values(motor_spec, index, False, 10, 2, 10)
        self.start_6.setEnabled(True)
    ##

    #Exp 5 Displays the values in labels after clicking the run button
    def run_motor_program(self):        
        speed = self.get_speed_value()
        load = self.get_load_value()
        voltage = self.get_voltage_value()
        coolant_flow = self.get_coolant_flow_value()
        result = motor_program(speed, load, voltage, coolant_flow)
        #Display Motor Efficiency
        motor_eff_percentage = result[10]
        self.moteff5_display.display(float(motor_eff_percentage[-1]))
        #Display Temperature
        motor_surface_temperature_K = result[11]
        self.temp5_display.display(float(motor_surface_temperature_K[-1]))
        #Display Torque
        motor_torque_out_Nm = result[7]
        self.torq5_display.display(float(motor_torque_out_Nm[-1]))
        #Display Voltage
        motor_voltage_V = result[8]
        self.lcdNumber_3.display(float(motor_voltage_V[-1]))
        #Display Current
        motor_current_A = result[9]
        self.i5_display.display(float(motor_current_A[-1]))
        #Display Power output
        motor_output_power_W = result[12]
        self.lcdNumber_22.display(float(motor_output_power_W[-1]))
        #Display Speed
        speed = result[14]
        self.lcdNumber_21.display(float(speed))
        #Display Regen Power
        motor_regen_power_W = result[13]
        self.lcdNumber_2.display(float(motor_regen_power_W[-1]))
        #load value slider
        self.load5_slider.valueChanged.connect(self.get_load_value)
        ##
        #rpm value slider
        self.rpm5_slider.valueChanged.connect(self.get_speed_value)
        ##
        #voltage value slider
        self.volt_slider.valueChanged.connect(self.get_voltage_value)
        ##
        #coolant flow value slider
        self.cool_slider.valueChanged.connect(self.get_coolant_flow_value)
        ##
    #Connect Slider and LCD
    def update_lcd(self, value, lcd_display):
        lcd_display.display(value)
    ##
    #Update the coolant display from 0.1 to 1
    def coolant_update_lcd(self, value):
        scaled_value = value / 10.0  # Scale the slider value to represent 0.0 to 1.0
        self.lcdNumber.display(scaled_value)
