    #5th Exp update excel for motor selection
    def update_fifth_ExcelCellValue(self, index):
        # Read the Excel file and get the input data
        input_data = read_excel("input_motor_dyno.xlsx")
        input_data = np.array(input_data)
        row_index = 1
        colunm_index = 1
        motor_selection = index + 1  
        input_data[row_index, colunm_index] = motor_selection
        wb = load_workbook("input_motor_dyno.xlsx")
        ws = wb.active
        ws.cell(row=row_index + 1, column=colunm_index + 1, value=motor_selection)
        wb.save("input_motor_dyno.xlsx")
        ##
    #Slider Values
    def get_speed_value(self):
        return self.rpm5_slider.value()

    def get_load_value(self):
        return self.load5_slider.value()

    def get_voltage_value(self):
        return self.volt_slider.value()

    def get_coolant_flow_value(self):
        return self.cool_slider.value()
    # Function to run excel_update.py
    def run_excel_update():
        subprocess.run(["python", "update_excel.py"], check=True)

    # Registering the function to run at exit
    atexit.register(run_excel_update)
